        <div className='Profile Header'>
            <h2>Profile</h2>

        <div className='User-info'>
            <img src={headshot} alt="user profile pic"></img>
            <h3>Jane Doe</h3>
            <p>Software Engineer</p>
            <p>Email: jdoe@gmail.com</p>
        <div className='volunteer-info'>

        </div>


        </div>

        </div>

    </div>
  )
}

export default userpf;
